import { TableUI } from "../../components/Table";
import { useTable, useSortBy, usePagination } from "react-table";
import { Pagination } from "semantic-ui-react";
const Results = () => {
  const data = [{ test: "hello" }, { test: "world" }];

  const {
    getTableProps,
    headerGroups,
    rows,
    prepareRow,
    // pagination only
    page,
    gotoPage,
    setPageSize,
    state: { pageIndex, pageSize },
  } = useTable<{ test: string }>(
    {
      columns: [
        {
          id: "NoHeader",
          columns: [
            {
              Header: "test",
              accessor: "test",
            },
          ],
        },
      ],
      data,
    },
    useSortBy,
    usePagination
  );
  return (
    <div className="Results">
      <h1>Results</h1>
      <div>Table here</div>
      <TableUI
        getTableProps={getTableProps}
        className="POF-table"
        // @ts-ignore
        headerGroups={headerGroups}
        // @ts-ignore
        prepareRow={prepareRow}
        page={page}
        // @ts-ignore
        rows={rows}
      />
      <Pagination totalPages={data.length} />
    </div>
  );
};

export default Results;
